import { View, Text, Image } from 'react-native';
import React from 'react';

const Plant = ({ plant }) => {
  // console.log('Plant()');
  const image = plant.ImagePath;
  return (
    <View>
      <Text>{plant.common[0]}</Text>
      <Image source={{ uri: image }}></Image>
    </View>
  );
};

export default Plant;
